import React from 'react';

import { Container, Profile } from './styles';

import defaultProfileImage from '../../assets/default.png';

export default function Sidebar() {
  return (
    <Container>
      <Profile>
        <img src={defaultProfileImage} alt="Profile" />
      </Profile>
      <ul>
        <li>Vendas</li>
        <li>Clientes</li>
        <li>Carteira</li>
        <li>Contato</li>
      </ul>
    </Container>
  );
}
